import * as axs from '../actions';

export const getDiariesAction = () => async (dispatch) => {
    try{
        const {data} = await axs.getDiariesApi();
        dispatch ({type: 'GET_ALL_POSTS', payload: data});
    } catch(error) {
        console.log(error.message);
    }
}
